INSERT INTO `hotel` (`id`, `name`, `star`, `phone`, `category_id`, `default_image`, `image`, `body`, `coordi_x`, `coordi_y`, `new`, `handling_price`, `updated_at`, `created_at`, `soft_delete`) VALUES
(40, 'The Peninsula Hong Kong', 5, 23698741, 9, '19912', '1544966763.jpg', '<!DOCTYPE html> <html> <head> </head> <body>\r\n<p><iframe src="//www.youtube.com/embed/4TiSvF79A4o" width="100%" height="400px" allowfullscreen="allowfullscreen"></iframe></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="color: #222222; font-family: arial, sans-serif;">香港半島酒店，為香港上海大酒店有限公司的旗艦酒店，亦是集團首間命名為「半島」的酒店，位於九龍尖沙咀梳士巴利道，是香港現存歷史最悠久的酒店，也是全球最著名及最豪華的酒店之一，為一家甲級高價酒店。基於其極為珍貴的歷史及建築價值，酒店建築被古物古蹟辦事處評審為一級歷史建築。</span></strong></span></p>\r\n</body> </html>', '        22.295077        ', '        114.171799        ', 0, 25, '2018-12-29 16:36:13', '2018-12-16 20:00:00', 0),
(41, 'Hong Kong Ocean Park Marriott Hotel', 5, 23698742, 5, '1901602364', 'null.jpg', '', '22.27526', '114.17226', 0, 0, '2018-12-16 20:00:00', '2018-12-16 20:00:00', 0),
(42, 'Marco Polo Hongkong Hotel', 5, 23698743, 7, '20509', '1545919102.jpg', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p style="box-sizing: border-box; margin: 1em 0px; font-size: 1.143em; color: #555555; font-family: myriad-pro-n4, myriad-pro, ''Myriad Pro'', sans-serif;">馬哥孛羅香港酒店聳立於名店林立的尖沙咀廣東道，坐落於九龍地區最繁忙的商業中心及購物熱點，可遠眺世界聞名的維多利亞海港；與天星小輪及郵輪碼頭僅一箭之遙，同時與本地最大型購物商場&mdash;海港城相連，方便客人享受購物、乘坐渡輪觀光之樂趣。</p>\r\n<p style="box-sizing: border-box; margin: 1em 0px; font-size: 1.143em; color: #555555; font-family: myriad-pro-n4, myriad-pro, ''Myriad Pro'', sans-serif;">經過一天緊湊的觀光活動或業務會議之後，客人可在665間客房或套房其中一間休息，利用免費的Wi-Fi無線上網及免費的handy智能旅遊手機，隨時與外界保持聯繫。賓客可使用集多功能於一身的handy智能旅遊手機，透過無限3G流動數據上網，隨時隨地搜尋世界各地資訊外，更可利用handy 智能手機無限撥打本地及國際電話(十個指定地區包括澳洲、中國、德國、日本、韓國、台灣、泰國、菲律賓、英國及美國)，讓賓客身處海外亦能與親友緊密溝通。賓客又可根據手機內置的實用觀光指南及購物、景點門票優惠，盡情探索香港的國際大都會，享受自在旅程。賓客亦可跳入泳池放鬆，或到健身室舒展筋骨。</p>\r\n<p style="box-sizing: border-box; margin: 1em 0px; font-size: 1.143em; color: #555555; font-family: myriad-pro-n4, myriad-pro, ''Myriad Pro'', sans-serif;">貴賓樓層以無與倫比的設施及服務，成為馬哥孛羅酒店待客以誠的標志，是喜歡個人化服務之客人的不二之選。另外，雅悅廳提供自助早餐丶下午茶美點丶全日咖啡及茶，以及黃昏美酒及小食，讓賓客在環境舒適丶格調柔和的氛圍下享受專屬自己的輕松時刻。</p>\r\n<p style="box-sizing: border-box; margin: 1em 0px; font-size: 1.143em; color: #555555; font-family: myriad-pro-n4, myriad-pro, ''Myriad Pro'', sans-serif;">香港號稱&ldquo;亞洲美食之都&rdquo;，酒店備有三間各具特色的餐廳及酒吧，包括意大利餐廳Cucina、全日供應國際美食的馬哥孛羅咖啡廳，以及大堂酒廊。</p>\r\n<p style="box-sizing: border-box; margin: 1em 0px; font-size: 1.143em; color: #555555; font-family: myriad-pro-n4, myriad-pro, ''Myriad Pro'', sans-serif;">無論籌備夢想婚禮還是完美的公司會議，酒店14間設備先進的多功能廳及高貴典雅的百年廳均能滿足不同需求。</p>\r\n<p style="box-sizing: border-box; margin: 1em 0px; font-size: 1.143em; color: #555555; font-family: myriad-pro-n4, myriad-pro, ''Myriad Pro'', sans-serif;">&nbsp;</p>\r\n<p style="box-sizing: border-box; margin: 1em 0px; font-size: 1.143em; color: #555555; font-family: myriad-pro-n4, myriad-pro, ''Myriad Pro'', sans-serif;"><img src="https://d33egvpdakv69f.cloudfront.net/media/images/marco_polo/hotels/hongkong/caring-logo_2018.jpg" alt="" /><img src="https://d33egvpdakv69f.cloudfront.net/media/images/marco_polo/hotels/hongkong/mdlogo_chi-100px.jpeg" alt="" /><img src="https://d33egvpdakv69f.cloudfront.net/media/images/marco_polo/hotels/hongkong/hkma_logo.png" alt="" /><img src="https://d33egvpdakv69f.cloudfront.net/media/images/marco_polo/hotels/hongkong/earth_silver.jpg" alt="" /></p>\r\n</body>\r\n</html>', '   22.296182   ', '   114.169906   ', 0, 10, '2018-12-27 21:58:22', '2018-12-16 20:00:00', 0),
