(737, 'Shangri-La Hotels Hong Kong', 5, 99987777, 1, '', '1546249271.jpg', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<div class="content-con" style="box-sizing: border-box; flex: 1 1 0%; margin-right: 40px; padding-top: 60px; color: #333333; overflow: hidden;">\r\n<div class="tit title-regular" style="box-sizing: border-box; font-family: PlayfairDisplay, Georgia, ''Times New Roman'', serif; font-size: 28px; line-height: 30px; overflow: hidden; text-overflow: ellipsis; white-space: nowrap;">About</div>\r\n<div class="desc text-regular" style="box-sizing: border-box; font-family: Montserrat, Verdana, Helvetica, Arial, sans-serif; margin-top: 20px; line-height: 20px; display: -webkit-box; -webkit-box-orient: vertical; -webkit-line-clamp: 7; overflow: hidden; max-height: 140px;">An elegant urban sanctuary soaring above the skyline&nbsp;<br style="box-sizing: border-box;" />Rising to a commanding 56 floors, Island Shangri-La, Hong Kong provides a peaceful escape and panoramic views of the iconic Peak and Victoria Harbour, in the very heart of Hong Kong.</div>\r\n<div class="list" style="box-sizing: border-box; margin-top: 40px;">\r\n<div class="item" style="box-sizing: border-box; position: relative; margin-top: 0px; margin-left: 26px; line-height: 20px;">565 spacious rooms and suites</div>\r\n<div class="item" style="box-sizing: border-box; position: relative; margin-top: 20px; margin-left: 26px; line-height: 20px;">8 award-winning restaurants and bars</div>\r\n<div class="item" style="box-sizing: border-box; position: relative; margin-top: 20px; margin-left: 26px; line-height: 20px;">Two-minute walk from Pacific Place Mall</div>\r\n</div>\r\n<a class="link-btn text-medium" style="box-sizing: border-box; text-decoration-line: none; font-family: Montserrat, Verdana, Helvetica, Arial, sans-serif; display: inline-block; min-width: 140px; margin-top: 60px; padding-left: 14px; padding-right: 14px; height: 36px; line-height: 36px; text-align: center; color: #876a20; border: 1px solid; cursor: pointer;" href="https://www.shangri-la.com/hongkong/islandshangrila/about/">Learn More</a></div>\r\n<div class="content-con" style="box-sizing: border-box; flex: 1 1 0%; margin-right: 40px; padding-top: 60px; color: #333333; overflow: hidden;">&nbsp;</div>\r\n<div class="img-con" style="box-sizing: border-box; position: relative; width: 600px; height: 500px;"><img class="img" style="box-sizing: border-box; border: 0px; vertical-align: middle; width: 600px; height: 500px; position: absolute; left: 0px; top: 0px; z-index: 2; background-color: #e7e8e9; color: #333333; font-family: Montserrat, Verdana, Helvetica, Arial, sans-serif; font-size: 12px;" src="https://www.shangri-la.com/uploadedImages/Shangri-la_Hotels/New_Website/ISL_AboutHotelBanner.jpg?w=600&amp;h=500&amp;mode=crop&amp;scale=both" /></div>\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>', ' 22.277217720952894 ', ' 114.16423286118459 ', 1, 100, '2018-12-31 17:46:59', '2018-12-31 17:41:11', 0),
(738, 'Sheraton Grande Tokyo Bay Hotel', 5, 66889988, 9, '', '1546250137.jpg', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<div id="summary" class="" style="color: #383838; font-family: BlinkMacSystemFont, -apple-system, ''Segoe UI'', Roboto, Helvetica, Arial, sans-serif;" data-et-mouseenter="customGoal:BUeeZaTaTaBEKMPXLae:1 customGoal:BUeeHNSPdMPISWXGBbLPYO:1\r\ncustomGoal:BUeeHNSPBAHT:1 customGoal:BUeeHNSPBAcZGPHe:1\r\ncustomGoal:BUeeHNSPCaASBaRDSGEXO:1 customGoal:BUeeZdbaBMRbBYWKOBLHXT:1" data-et-click="customGoal:BUeeZaTaTaBEKMPXLae:2 customGoal:BUeeHNSPdMPISWXGBbLPYO:2\r\ncustomGoal:BUeeHNSPBAHT:2 customGoal:BUeeHNSPBAcZGPHe:2\r\ncustomGoal:BUeeHNSPCaASBaRDSGEXO:2 customGoal:BUeeZdbaBMRbBYWKOBLHXT:2">\r\n<p>東京灣喜來登大飯店是東京迪士尼度假區（Tokyo Disney Resort）的官方飯店，館內設有室內和室外游泳池、迪士尼專賣店、兒童遊樂區和 4 間餐廳。步行 2 分鐘即可抵達迪士尼度假區線（Disney Resort Line）的海濱站（Bayside Station）。飯店客房寬敞舒適，配有喜來登甜夢之床（Sheraton Sweet Sleeper bed）與絲緞床單。</p>\r\n<p>每間客房均設有休息區，並配有可收看衛星頻道和有線頻道的液晶電視。多數客房陽台享有迪士尼度假區或東京灣的景緻。客房內備有拖鞋和浴袍，並提供 24 小時客房服務。房內亦備有咖啡機。</p>\r\n<p>飯店內設有健身房及附桑拿浴的公共澡堂，另外亦可應客人要求提供按摩服務。大廳設有可免費上網的電腦、印表機，並提供免費 WiFi。飯店提供當日入住前行的李寄存服務。</p>\r\n<p>Caf&eacute; Toastina 咖啡廳的設計宛如豪華郵輪，提供香濃咖啡和美味糕點。館內的 Asuka 餐廳供應日本料理，Maihama 餐廳供應鐵板燒特色美食，另外 Grand Cafe 咖啡廳則供應各式國際菜餚。</p>\r\n<p>飯店提供免費接駁服務，協助客人前往鄰近的單軌電車海濱站（Bayside Monorail Station）。從該站搭乘單軌電車加步行， 10 分鐘內即可抵達 JR 舞濱站（JR Maihama Station）。 從舞濱站轉乘火車，只需 20 分鐘即可抵達東京車站（Tokyo Station）。成田機場和羽田機場有機場豪華巴士（Airport Limousine Bus）可直達飯店。&nbsp;</p>\r\n</div>\r\n<p class="hp-desc-review-highlight hp-desc-traveller-type--ph-v0" style="color: #383838; font-family: BlinkMacSystemFont, -apple-system, ''Segoe UI'', Roboto, Helvetica, Arial, sans-serif;">情侶特別喜歡這個位置－並給他們的雙人旅行住宿體驗&nbsp;<strong>8.5</strong>&nbsp;分</p>\r\n</body>\r\n</html>', '35.699489924599796', '139.82558496577212', 1, 50, '2018-12-31 17:55:37', '2018-12-31 17:55:37', 0);
